            <tr>
                <td>{{ offretravail.idoffre }}</td>
                <td>{{ offretravail.titreoffre }}</td>
                <td>{{ offretravail.descriptionoffre }}</td>
                <td>{{ offretravail.categorieoffre }}</td>
                <td>{{ offretravail.nickname }}</td>
